export const ContentsListHeader = styled.header`
  text-align: center;

  h1,
  h2 {
    &:after {
      margin: 0 auto;
      content: "";
      display: block;
      width: 98%;
      height: 3px;
      background: var(--orange);
    }
  }
`

export const ContentsOrderedListWrapper = styled.ol`
  column-count: 1;
  list-style: none;
  padding: 0;
  margin: 0;
  display: flex;
  flex-wrap: wrap;
  width: 100%;

  li {
    padding: 5px;
    margin: var(--spacing-1);
    box-sizing: border-box;
    border: 1px solid var(--black);
    border-radius: 5px;
    background-color: #fff;

    a {
      color: var(--black);
      text-decoration: none;
    }

    h2 {
      font-size: var(--fontSize-2);
    }
  }
  .thumbnail {
    float: left;
  }

  @media screen and (min-width: calc(512px + 160px)) {
    column-count: 2;

    li {
      padding: 15px;
      width: 48%;

      h2 {
        font-size: var(--fontSize-3);
      }

      a {
        &:hover h2 {
          text-decoration: underline;
        }
      }
    }
  }
  @media screen and (min-width: calc(768px + 330px)) {
    column-count: 3;

    li {
      width: 32%;
    }
  }
`

export const NormalAreaWrapper = styled.div`
  background-color: #fff;
`
","import * as React from "react"

import { graphql, Link } from "gatsby"
import { PageContext } from "gatsby/internal"
import { convertCategory, mergePosts } from "../utilFunction"
import Layout from "../components/layout"
import Seo from "../components/seo"
import { GatsbyImage } from "gatsby-plugin-image"
import { ContentsListHeader, ContentsOrderedListWrapper } from "../style"

const CategoryList = ({
  pageContext,
  data,
  location,
}: {
  pageContext: PageContext
  data: any
  location: Location
}) => {
  const tagName = pageContext.tag as string
  const posts = mergePosts(data.allMarkdownRemark, data.allWpPost, data.allFile)
  const title = `【${tagName}】タグ 一覧`

  if (posts.length === 0) {
    return (
      <Layout location={location}>
        <Seo title={title} location={location} />
        <p>そのタグの記事はありません。</p>
      </Layout>
    )
  }

  return (
    <Layout location={location}>
      <ContentsListHeader>
        <h1>{title}</h1>
        <p>{posts.length} 記事あります</p>
      </ContentsListHeader>
      <ContentsOrderedListWrapper>
        {posts.map(post => {
          return (
            <li key={post.slug}>
              <article
                className="post-list-item"
                itemType="http://schema.org/Article"
              >
                <Link to={`/${convertCategory(post.category)}/${post.slug}`}>
                  <h2>
                    <span>{post.title}</span>
                  </h2>
                  <section>
                    <div>
                      <small>
                        <time>{post.date}</time>
                      </small>
                    </div>
                    <div className="thumbnail">
                      {typeof post.gatsbyImage === "undefined" || (
                        <GatsbyImage
                          alt={post.altText}
                          image={post.gatsbyImage}
                          className="thumbnail"
                        />
                      )}
                    </div>
                    <p dangerouslySetInnerHTML={{ __html: post.excerpt }} />
                  </section>
                </Link>
              </article>
            </li>
          )
        })}
      </ContentsOrderedListWrapper>
    </Layout>
  )
}

export default CategoryList

export const Head = ({
  pageContext,
  location,
}: {
  pageContext: PageContext
  location: Location
}) => {
  return (
    <Seo
      title={`【${pageContext.tag}】タグ 一覧`}
      description={`【${pageContext.tag}】タグの記事一覧です`}
      location={location}
    />
  )
}

export const pageQuery = graphql`
  query ($tag: String) {
    allMarkdownRemark(
      sort: { frontmatter: { date: DESC } }
      filter: { frontmatter: { tags: { in: [$tag] } } }
    ) {
      nodes {
        excerpt
        fields {
          slug
        }
        frontmatter {
          title
          date(formatString: "YYYY/MM/DD")
          description
          featuredImagePath
          category
        }
      }
    }
    allWpPost(
      sort: { date: DESC }
      filter: { tags: { nodes: { elemMatch: { name: { eq: $tag } } } } }
    ) {
      nodes {
        title
        excerpt
        slug
        date(formatString: "YYYY/MM/DD")
        featuredImage {
          node {
            altText
            gatsbyImage(
              width: 100
              height: 100
              formats: [AUTO, WEBP, AVIF]
              placeholder: BLURRED
            )
          }
        }
        categories {
          nodes {
            name
          }
        }
      }
    }
    allFile(filter: { sourceInstanceName: { eq: "images" } }) {
      edges {
        node {
          relativePath
          childImageSharp {
            gatsbyImageData(
              width: 100
              height: 100
              formats: [AUTO, WEBP, AVIF]
              placeholder: BLURRED
            )
          }
        }
      }
    }
  }
`
","/**
 * SEO component that queries for data with
 * Gatsby's useStaticQuery React hook
 *
 * See: https://www.gatsbyjs.com/docs/how-to/querying-data/use-static-query/
 */

import * as React from "react"
import config from "../../gatsby-config"

type SeoProps = {
  title: string
  description?: string
  location: Location
  imagePath?: string
  post?: CommonPost
  children?: React.ReactNode
}

const Seo = ({
  title,
  description,
  location,
  imagePath,
  post,
  children,
}: SeoProps) => {
  const { siteMetadata } = config as { siteMetadata: SiteMetadata }
  const rootPath = `${__PATH_PREFIX__}/`
  const isRootPath = location.pathname === rootPath

  const metaDescription = description || siteMetadata.description
  const fullTitle = isRootPath
    ? siteMetadata.title
    : `${title} | ${siteMetadata.title}`
  const canonicalUrl =
    siteMetadata.siteUrl + location.pathname.replace(/\/page\/([0-9])+\//, "")
  const imageUrl = `${siteMetadata.siteUrl}${
    imagePath ? imagePath : "/favicon.webp"
  }`

  function createJsonLd() {
    // JSON-LDの設定
    const author = [
      {
        "@type": "Person",
        name: siteMetadata.author.name,
        description: siteMetadata.author.summary,
        url: siteMetadata.siteUrl,
        sameAs: [siteMetadata.social.twitter, siteMetadata.social.github],
      },
    ]

    const publisher = {
      "@type": "Organization",
      name: siteMetadata.title,
      description: siteMetadata.description,
      logo: {
        "@type": "ImageObject",
        url: `${siteMetadata.siteUrl}/favicon.webp`,
        width: 512,
        height: 512,
      },
    }

    let jsonLd = [
      {
        "@context": "http://schema.org",
        "@type": isRootPath ? "webSite" : "webPage",
        inLanguage: "ja",
        url: canonicalUrl,
        name: title,
        author: author,
        publisher: publisher,
        image: imageUrl,
        description: metaDescription,
      },
    ]
    if (post) {
      const article = {
        "@context": "http://schema.org",
        "@type": "BlogPosting",
        url: canonicalUrl,
        name: post.title,
        headline: post.title,
        image: {
          "@type": "ImageObject",
          url: imageUrl,
        },
        description: post.excerpt,
        datePublished: new Date(post.date),
        dateModified: new Date(post.dateModified),
        mainEntityOfPage: {
          "@type": "WebPage",
          "@id": canonicalUrl,
        },
        author: author,
        publisher: publisher,
      }
      // @ts-ignore
      jsonLd = [...jsonLd, article]
    }
    return JSON.stringify(jsonLd)
  }

  let jsonLd = createJsonLd()

  return (
    <>
      <html lang="ja" />
      <title>{fullTitle}</title>
      <link rel="canonical" href={canonicalUrl} />
      <script type="application/ld+json">{jsonLd}</script>

      <meta name="description" content={metaDescription} />
      {imagePath && (
        <>
          <meta property="og:image" content={imageUrl} />
          <meta property="og:url" content={imageUrl} />
          <meta property="twitter:image" content={imageUrl} />
        </>
      )}
      <meta property="og:title" content={fullTitle} />
      <meta property="og:description" content={metaDescription} />
      <meta
        property="og:type"
        content={`${isRootPath ? "website" : "webpage"}`}
      />
      <meta name="twitter:card" content="summary" />
      <meta name="twitter:creator" content={siteMetadata.social.twitter} />
      <meta name="twitter:title" content={fullTitle} />
      <meta name="twitter:description" content={metaDescription} />
      {children}
    </>
  )
}

export default Seo
